import React from "react";

import "./Projects.css";

const Project = () => {
  return (
    <div className="Project d-flex flex-column justify-content-center">
      <div class="card-container" style={{ width: "20vw", height: "20vh" }}>
        <div class="card-flip">
          <div class="front">
            <div className="card">
              <div className="card-body">
                <div className="card-text">
                  <p>Hola</p>
                </div>
              </div>
            </div>
          </div>
          <div class="back">
            <h1
              style={{
                width: "20vw",
                height: "20vh",
                border: "1px solid black",
              }}
            >
              Good Bye
            </h1>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Project;
